import React from "react";
import Nav from "../nav/Nav";
import style from "./header.module.css";

/**
 * 
 * @param {*} The content of the page
 * @returns 
 */

function Header({ changeContent }) {
  return (
    <header>
      <Nav changeContent={changeContent} />
    </header>
  );
}

export default Header;
